import React from 'react'
import {Fa500Px, FaAddressBook, FaLaptopCode} from "react-icons/fa";
import "./Posts.css";


const Select = (props) => {
    return (
        <select className={props.className} onChange={props.onChange}>
        <option value={<FaLaptopCode className="image"/>}>Shop</option>
        <option value={<Fa500Px className="image"/>}>Tech</option>
        <option value={<FaAddressBook className="image"/>}>Rest</option>
      </select>
    )
}



export default Select;
